(1, '/* Ocultar rodapés */\r\nfooter,\r\nbody > div > div.layout-container > div > div > footer > div > div,\r\nbody > div.layout-wrapper.layout-content-navbar > div > div > footer > div > div {\r\n    display: none;\r\n}\r\n\r\n/* Ocultar elementos específicos por ID */\r\n#zapzap,\r\n#interacao,\r\n#zapzap1 > a,\r\n#zapzap2 > a {\r\n    display: none;\r\n}\r\n\r\n/* Forçar exibição do ícone com a classe .bi-door-open */\r\n.bi-door-open {\r\n    display: block !important;\r\n}\r\n\r\n/* Estilo para o editor */\r\n#editor > div.ace_scroller {\r\n    background-color: #696969;\r\n}\r\nbody > div.layout-wrapper.layout-content-navbar \r\n  > div.layout-container > div > div \r\n  > div.container-xxl.flex-grow-1.container-p-y \r\n  > div:nth-child(1) > div > div > div \r\n  > div.col-sm-5.text-center.text-sm-left > div {\r\n    \r\n    background-image: url(\'https://i.ibb.co/0j3z3RLP/4-PERFIL-DE-APLICATIVO-MASTER-NET-512x512.png\');\r\n    background-size: cover;\r\n    background-position: center;\r\n    width: 200px; /* Ajuste conforme necessário */\r\n    height: 200px;\r\n    position: relative;\r\n}\r\n\r\nbody > div.layout-wrapper.layout-content-navbar \r\n  > div.layout-container > div > div \r\n  > div.container-xxl.flex-grow-1.container-p-y \r\n  > div:nth-child(1) > div > div > div \r\n  > div.col-sm-5.text-center.text-sm-left > div > img {\r\n    \r\n    display: none; /* Esconde a imagem original */\r\n}\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n/* Alteração do banner (comentada para referência futura)\r\n.background-image-card {\r\n    background-image: url(\'/img/logo1.png\') !important;\r\n    background-color: #363636 !important;\r\n    background-size: cover;\r\n    background-repeat: no-repeat;\r\n    background-position: center;\r\n}\r\n*/\r\n\r\n/* Base geral do layout */\r\n\r\n\r\n', 'Teste rapido = ola mundo');
